commits.content:
@import url("https://fonts.googleapis.com/css2?family=Poppins:wght@300;400;500;600;700&display=swap");

*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: "Poppins",sans-serif;
}

body{
    display: flex;
   justify-content: center;
   align-items: center;
    height: 100vh;
    width: 100%;
    background: linear-gradient(to bottom right, rgb(255, 139, 50), rgb(255, 34, 18));
}

.page{
   display: flex;
   justify-content: center;
   align-items: center;
   flex-direction: column;
   background: #fff;
   width: 580px;
   height: 202px;
}

h1 {
    padding: 0 20px;
}

p {
    margin-bottom: 20px;
}

.box {
    background: rgb(255, 34, 18);
    color: #fff;
    height: 50px;
    width: 450px;
    display: flex;
    justify-content: space-evenly;
    align-items: center;
}

div{
    border: 2px solid #000;
}
